import React from "react";

const Home = () => {
  return (
    <div className="container text-center" style={{ marginTop: "12rem" }}>
      <div className="alert alert-primary p-5">
        <h1>NBA Watcher Home</h1>
      </div>
    </div>
  );
};

export default Home;
